- input: "TEXT\x1CC00247403\x1C.TEXT\x1C\x1CF3XA\x1CThe aggregate year-to-date totals
    on Schedule A show the total contributions from individuals that were received
    by the PAC in that year.  Earmarked donations for campaigns (NORPAC acting as
    a conduit) entered as memos are not included in the aggregate totals.  Therefore
    the aggregate year-to-date total may appear incorrect (as it is often less than
    the total earmark) but it is actually recorded and calculated correctly.    The
    NORPAC Annual Mission to Washington DC trip consists of citizen activists meeting
    with hundreds of members of Congress to discuss legislation.  No mission expenditures
    on Schedule B are on behalf of specifically identified federal candidates and
    therefore no additional information needs to be disclosed on Schedule B or E.
    \    The NORPAC Annual Mission to Washington DC trip consists of citizen activists
    meeting with hundreds of members of Congress to discuss legislation.  Any public
    communications such as ads are designed to recruit members to the mission and
    do not express advocacy or voter driver activity for any Federal candidates.  Therefore
    no additional information needs to be disclosed on Schedule B or E\n"
